    false,nt"url": null,nt"notes": "Since 2004, over 85% of the refuge has
    been systematically surveyed by volunteers. The refuge has recently purchased several
    new tracts that need to be surveyed and mapped. Funding from this grant will provide
    funds to hire either an AmeriCorps member or independent contractor through the
    Refugeu2019s Friendu2019s Group. The AmeriCorps member/contractor will assist with
    coordinating the Refuge EDRRP through the summer of 2015. The AmeriCorps member/contractor,
    Refuge Wildlife Biologist, Volunteer Coordinator and Friends of Turnbull NWR will
    recruit and train volunteers in the use of GPS equipment, survey software and EDRRP
    protocols. In addition to the refuge work, the Channeled Scablands Cooperative Weed
    Management Area has developed a mobile weed mapping application and will host a
    number of workshops on weed identification, prevention and control, recruiting volunteers
    and conducting weed mapping training. The AmeriCorps member/Contractoru2019s and
    other volunteers will also provide support for this cooperative effort.",nt"license_title":
